import "./BookingForm.css"

export const FutureBookings = ({ requests }) => {

    return (<>
        {requests.isApproved ?
            <div> 
                <h2>Your Accepted Bookings</h2>
                {requests.map(request => { 
                    <div>{request.bandName}</div>
                })}
            </div> : "You have no future bookings"}
    </>)
}
